                  prefix: <UserOutlined />,
                }}
                placeholder="请输入账号"
                rules={[
                  {
                    required: true,
                    message: '请输入账号',
                  },
                  {
                    min: 4,
                    message: '账号长度不能小于4位',
                  },
                  {
                    pattern: /^[a-zA-Z0-9_]+$/,
                    message: '账号只能包含字母、数字和下划线',
