      <div>
        <Image src={record.memberAvatar || 'https://28082003.com/images/preview.jpg'} width={100} />
      </div>
    ),
  },
  {
    title: '性别',
    dataIndex: 'gender',
    valueEnum: {
      0: { text: '未知', status: 'Default' },
      1: { text: '男', status: 'Success' },
      2: { text: '女', status: 'Error' },
    },
  },
  {
    title: '角色',
    dataIndex: 'memberRole',
    valueType: 'select',
    valueEnum: {
      member: { text: '普通会员', status: 'Default' },
      admin: { text: '管理员', status: 'Success' },
    },
    render: (_, record) => {
      const color = record.memberRole === 'admin' ? 'success' : 'processing';
      return (
        <Tag color={color}>
          {record.memberRole === 'admin' ? '管理员' : '普通会员'}
        </Tag>
      );
    },
