              memberAccount: params.memberAccount,
              memberRole: params.memberRole,
              gender: params.gender,
            },
          });
          console.log('响应数据:', res);
          return {
            data: res.records || [],
            success: true,
            total: Number(res.total) || 0,
          };
        }}
        editable={{
          type: 'single',
