          ]}
        />
        <ProFormText
          name="memberAccount"
          label="会员账号"
          rules={[
            {
              required: true,
              message: '请输入会员账号',
            },
            {
              min: 4,
              message: '账号长度不能小于4位',
            },
            {
              pattern: /^[a-zA-Z0-9_]+$/,
              message: '账号只能包含字母、数字和下划线',
            },
          ]}
        />
        <ProFormSelect
          name="gender"
          label="性别"
          valueEnum={{
            0: '未知',
            1: '男',
            2: '女',
          }}
          rules={[
            {
              required: true,
              message: '请选择性别',
            },
          ]}
        />
        <ProFormSelect
          name="memberRole"
          label="角色"
          valueEnum={{
            member: '普通会员',
            admin: '管理员',
          }}
          rules={[
            {
              required: true,
              message: '请选择角色',
            },
          ]}
        />
      </ModalForm>
    </div>
  );
};

